import "./styles/leaderboard.css";
import first from "../media/first.png";
import second from "../media/second.png";
import third from "../media/third.png";
import usuario from "../media/user.png";

const LeaderBoard = () => {
  return (
    <>
      <div className="container-leader-board">
        <fieldset className="fieldset-leader">
          <legend>Tabla de liderazgo</legend>
          <div className="container-content-leader">
            <div className="container-place-icons">
              <div className="container-place-user">
                <img className="place-icon" src={first} alt="" />
                <img className="user-icon-leader" src={usuario} alt="" />
                {/* <h3>jaja</h3> */}
              </div>
              <div>
                <img className="place-icon" src={second} alt="" />
                <img className="user-icon-leader" src={usuario} alt="" />
              </div>
              <div>
                <img className="place-icon" src={third} alt="" />
                <img className="user-icon-leader" src={usuario} alt="" />
              </div>
            </div>
          </div>
        </fieldset>
      </div>
    </>
  );
};

export default LeaderBoard;
